import React from "react";

function ColorBtns() {
  return (
    <div>
      <button id="red" className="rounded-full bg-red-500 ml-5 p-4"></button>
      <button id="purple" className="rounded-full bg-purple ml-5 p-4"></button>
      <button id="yellow" className="rounded-full bg-yellow ml-5 p-4"></button>
      <button id="blue" className="rounded-full bg-sky ml-5 p-4"></button>
      <button id="gray" className="rounded-full bg-gray ml-5 p-4"></button>
    </div>
  );
}

export default ColorBtns;
